  false,\n\t\"url\": null,\n\t\"notes\": \"Freshwater plumes from rain run-off into
  Kaneohe Bay is the focus for the investigation. Measurements in this data set are
  currents as measured by an moored Acoustic Doppler Current Profiler (ADCP) and a
  Nortek current meter. Data were collected during November 2005 - March 2007 by members
  of the Department of Oceanography at the University of Hawaii. The ADCP sensor includes
  temperature at the transducer depth of 13 m. The Nortek current meter included ancillary
  measurements including temperature and pressure. Temperature and salinity data taken
  at 24 stations as part of this project are available from NODC accession 0039532.\",\n\t\"license_title\":
